import { BsArrowLeft } from "react-icons/bs";
export const TicketHistory = () => {
  return (
    <>
      <div className="custom_container">
        <TopPageTitle
          TitleLink={-1}
          TilelIcon={<BsArrowLeft />}
          Name="Add New Employee"
        />
        <h1>Ticket History</h1>
      </div>
    </>
  );
};
